import 'dart:async';
import 'dart:io';

import 'package:connectivity/connectivity.dart';
import 'package:flutter/material.dart';
import 'package:flutter/services.dart';
import 'package:flutter/widgets.dart';
class imageui extends StatefulWidget {
  @override
  _imageuiState createState() => _imageuiState();
}

class _imageuiState extends State<imageui> {

  StreamSubscription connectivitySubscription2;
  ConnectivityResult previous1;
  bool dialogshown =false;

  List<String> code = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ];
  List<String> nature = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ];

  List<String> computer = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ];

  List<String> toShow = [
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
  ];

  Future<bool> checkInternet() async{
    try{
      final result = await InternetAddress.lookup('google.com');
      if(result.isNotEmpty && result[0].rawAddress.isNotEmpty){
        return Future.value(true);
      }
    } on SocketException catch(_){
      return  Future.value(false);
    }
  }

  @override
  void initState() {
    super.initState();
    connectivitySubscription2 = Connectivity().onConnectivityChanged.listen((ConnectivityResult connResult) {
      if(connResult == ConnectivityResult.none){
        dialogshown = true;
        showDialog(context: context,
            builder: (context) => AlertDialog(
              title: Text('ERROR'),
              content: Text("No Internet Detected"),
              actions: <Widget>[
                FlatButton(onPressed: () => SystemChannels.platform.invokeMethod('Systemnavigator.pop'), child: Text("Exit"),)
              ],
            ));
      }else if(previous1 == ConnectivityResult.none){
        dialogshown = false;
        checkInternet().then((value){
          if(value == true){
            if(dialogshown == true){
              dialogshown = false;
              Navigator.pop(context);
            }
          }
        });
      }
      previous1 = connResult;
    });

  }
  @override
  void dispose() {
    super.dispose();
    connectivitySubscription2.cancel();
  }
  void createList(String kword){
    if(kword == "code"){
      toShow = [];
      setState(() {
        for(var srcs in code){
          toShow.add(srcs);
        }
      });
    }else if(kword == "nature"){
      toShow = [];
      setState(() {
        for(var srcs in nature){
          toShow.add(srcs);
        }
      });
    }else{
      toShow = [];
      setState(() {
        for(var srcs in computer){
          toShow.add(srcs);
        }
      });
    }
  }

  Widget cards(String src){
    return Card(
      elevation: 5,
      shape: RoundedRectangleBorder(borderRadius: BorderRadius.circular(10.0)),
      clipBehavior: Clip.antiAlias,
      child: Column(
        mainAxisAlignment: MainAxisAlignment.start,
        children: <Widget>[
          Image.network(src),
        ],
      ),
    );
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      backgroundColor: Colors.white,
      appBar: AppBar(
        backgroundColor: Colors.white,
        elevation: 0,
        centerTitle: true,
        title: Text(
          "ImageViewer",
          style: TextStyle(
            color: Colors.red,
            fontSize: 24.0,
            fontFamily: "Consolas",
          ),
        ),
      ),
      body: SingleChildScrollView(
        child: Column(
          children: <Widget>[
            Row(
              children: <Widget>[
                Expanded(
                    child: FlatButton(
                      onPressed: () => createList("code"),
                      child: Text(
                        "Code",
                        style: TextStyle(
                          fontSize: 18.0,
                          fontFamily: "Verdana",
                          color: Colors.red[600],
                        ),
                      ),
                    ),
                ),
                Expanded(
                    child: FlatButton(
                      onPressed: () => createList("nature"),
                      child: Text(
                        "Nature",
                        style: TextStyle(
                          fontSize: 18.0,
                          fontFamily: "Verdana",
                          color: Colors.red[600],
                        ),
                      ),
                    ),
                ),
                Expanded(
                    child: FlatButton(
                      onPressed: () => createList("computer"),
                      child: Text(
                        "Computers",
                        style: TextStyle(
                          fontSize: 18.0,
                          fontFamily: "Verdana",
                          color: Colors.red[600],
                        ),
                      ),
                    ),
                ),
              ],
            ),
            Column(
              children: <Widget>[
                cards(toShow[0]),
                cards(toShow[1]),
                cards(toShow[2]),
              ],
            )
    ],
        ),
      ),
    );
  }
}
